import React from "react";
import { Link } from "react-router-dom";
import { MemoMainPage } from "../pages/MainPage";

const Header = function() {
    return(
        <header className="head__block">
            <h1 className="head__text">ProFilm</h1>
            <div className="navbar__block">
                
            <div className="navbar__link"><Link to="/">Home</Link></div>
            <div className="navbar__link"><Link to="/about">About</Link></div>
            </div>
        </header>
    )
}

export default Header;
